import ItemPage from "../src/pages/items/ItemsPage";
import PandaLogo from "./asset/logo/logo.png";
import Profile from "./asset/icon/ic_profile.png";
import "./Style.css";

function App() {
  return (
    <>
      <nav>
        <a href="/">
          <img src={PandaLogo} alt="판다로고" />
        </a>
        <div className="menu">
          <a>자유게시판</a>
          <a>중고마켓</a>
        </div>
        <a>
          <img src={Profile} alt="프로필" />
        </a>
      </nav>
      <div>
        <ItemPage />
      </div>
    </>
  );
}

export default App;
